$(document).ready(function(){var a={UI:{menuIsHidden:true,},init:function(){this.getCurrentYear();this.bindEvents()},bindEvents:function(){$(".menu-btn").on("click",this.navToggle.bind(this));$("ul.filters").on("click","li span",this.markFilter.bind(this));$(document).keydown(this.checkForEscapeKey.bind(this));$(".grp").on("click",this.expandResume.bind(this))},checkForEscapeKey:function(b){var c=27;if(b.which===c){this.cancelNav()}},navToggle:function(){$("#overlay-bg").toggleClass("hidden");this.UI.menuIsHidden=!this.UI.menuIsHidden;$("#overlay-bg").attr("aria-hidden",this.UI.menuIsHidden);$(".menu-btn").toggleClass("open");$("body").toggleClass("noscroll")},cancelNav:function(){$("#overlay-bg").addClass("hidden");this.UI.menuIsHidden=true;$("#overlay-bg").attr("aria-hidden",this.UI.menuIsHidden);$(".menu-btn").removeClass("open");$("body").removeClass("noscroll")},markFilter:function(b){$("ul.filters li span").removeClass("selected-filter");$(b.target).addClass("selected-filter")},getCurrentYear:function(){var c=new Date();var b="&copy;"+c.getFullYear();$(".year").html(b)},expandResume:function(d){var b=$(d.target).parents("span.grp");var c=$(b).find(".r-detail");$(c).toggle(300);$(".r-detail").not(c).hide(300)}};a.init()});